<tramite><SESION>37/360</SESION><FECHA>31/07/2012</FECHA><DESCRIPCIONTRAMITE>Cuenta de proyecto . Pasa a Comisión de Constitución, Legislación, Justicia y Reglamento y a la de Hacienda, en su caso.</DESCRIPCIONTRAMITE><ETAPDESCRIPCION>Primer trámite constitucional</ETAPDESCRIPCION><CAMARATRAMITE>C.Diputados</CAMARATRAMITE></tramite>
<tramite><SESION>37/360</SESION><FECHA>31/07/2012</FECHA><DESCRIPCIONTRAMITE>Por acuerdo de Comités el proyecto será considerado  primero por la Comisión de Economía y luego por la   de Constitución, Legislación, Justicia y Reglamento.</DESCRIPCIONTRAMITE><ETAPDESCRIPCION>Primer trámite constitucional</ETAPDESCRIPCION><CAMARATRAMITE>C.Diputados</CAMARATRAMITE></tramite>
