<tramite><SESION>39/360</SESION><FECHA>07/08/2012</FECHA><DESCRIPCIONTRAMITE>La Sala acuerda que en primer informe el proyecto sea considerado solamente por la Comisión de Economía y en segundo informe sea analizado por las Comisiones de Constitución, Legislación, Justicia y Reglamento y de Economía, unidas.</DESCRIPCIONTRAMITE><ETAPDESCRIPCION>Primer trámite constitucional</ETAPDESCRIPCION><CAMARATRAMITE>C.Diputados</CAMARATRAMITE></tramite>
