<tramite><SESION>92/360</SESION><FECHA>08/01/2013</FECHA><DESCRIPCIONTRAMITE>Por acuerdo de los Comités, ratificado por la Sala, se autoriza a la Comisión de Economía para discutir en general y en particular la iniciativa en el primer informe. Asimismo, se acuerda que el proyecto será conocido en el segundo informe sólo por la Comisión de Economía y no por Comisiones Unidas como se había resuelto con fecha 7 de agosto de 2012.</DESCRIPCIONTRAMITE><ETAPDESCRIPCION>Primer trámite constitucional</ETAPDESCRIPCION><CAMARATRAMITE>C.Diputados</CAMARATRAMITE></tramite>
